import React from 'react'; 
import {Navbar, Container} from "react-bootstrap";

const Header: React.FC = (props: any) => {
    return ( <Navbar bg="primary" variant="dark">
                <Container>
      <Navbar.Brand href="#home">
      React Bootstrap
      </Navbar.Brand>
    </Container>
  </Navbar>);
}

export default Header;
